import React from 'react'
import Afran from '../Assets/afran.jpg'

function Righr_Side() {
    return (
        <div style={{
            
         backgroundImage: `url(${Afran})`, backgroundSize:'cover',
         backgroundPosition:'center',height:'100vh',width:'100vw',
         backgroundRepeat:'no-repeat',
         opacity:'0.5'
        
         }}>
            <h1>broo</h1>
        </div>
    )
}

export default Righr_Side
